import React from "react";
import './Patient.css';

function PatientComponent() {
  return (
    <div className="Patient-body-container">

      {/* Timeline of the patient medical history */}
      <div className="timeline-container">
        <div className="timeline-header"> Timeline of Health Activities </div>
        <div className="timeline">
          {/* Example timeline event */}
          <div className="timeline-event">
            <div className="timeline-date">June 1, 2022</div>
            <div className="timeline-content">
              <h3>Event Title</h3>
              <p>Event description goes here.</p>
            </div>
          </div>
          {/* Example timeline event */}
          <div className="timeline-event">
            <div className="timeline-date">July 15, 2022</div>
            <div className="timeline-content">
              <h3>Event Title</h3>
              <p>Event description goes here.</p>
            </div>
          </div>
        </div>
      </div>

      {/* Profile of the patient */}
      <div className="profile-container">
        <h1>Profile of the Patient</h1>
      </div>

    </div>
  );
}

export default PatientComponent;
